import React from 'react'

function MyOrder() {
    return (
        <div>
            <div className="cart-items">
        <h2>MY GOLOCAL ORDERS({cartItems.length})</h2>
          <Container className="products-container" >
          <Row xs={1} md={1}>
          {content}
          </Row>
        </Container>
        </div>
        </div>
    )
}

export default MyOrder
